import React from 'react';

function Product({imgSrc, name, price}) {
  return (
    <div className="child">
      <img src={imgSrc} alt={name} />
      <p>
        <strong>{name}</strong>
        <br />
        {price} դր/1կտ
        <br />
        <button className="btn">Գնել</button>
      </p>
    </div>
  );
}

function ProductList() {
    return (
      <div className="parent">
        <Product
          imgSrc="img/наполеон.jpg"
          name="Նապոլեոն"
          price="600"
        />
        <Product
          imgSrc="img/пьяная.jpg"
          name="Հարբած բալ"
          price="600"
        />
        <Product
          imgSrc="img/Торт-мужской-идеал-2.jpg"
          name="Տղամարդու Իդեալ"
          price="800"
        />
        <Product imgSrc="img/эскимо.jpg" name="Էսկիմո" price="700" />
        <Product imgSrc="img/микадо.jpg" name="Միկադո" price="800" />
        <Product imgSrc="img/paxlava.jpg" name="Փախլավա" price="800" />
      </div>
    );
  }
  
  

export default Main;
